import React from 'react';

function App() {
    let likes = 0;

    return (
        <div className="App">
            <p>Likes: { likes }</p>
            <button onClick={() => likes += 1}>Like</button>
            <button onClick={() => likes -= 1}>Dislike</button>
        </div>
    );
}

export default App;
